import "../css/temphome.css";
import 'bootstrap/dist/css/bootstrap.min.css';

const TempHome = () => {
    return (
        <div>

            <div class="container">

                <h2 class="font-weight-light text-center text-lg-left mt-4 mb-0">Popular products</h2>

                <hr class="mt-2 mb-5"></hr>
                <div class="row text-center text-lg-left">


                    <div class="col-lg-3 col-md-4 col-6 card-bike-category">
                        <a href="product" class="d-block mb-4 h-100">
                        <img src="https://uploads-ssl.webflow.com/651a123911b4ed7aad4be880/651a17390a0477eb5c7a0a01_simple-beige-mens-shirt(1).jpg" loading="lazy" alt="" width="300px" height="220px"/>
                        </a>
                    </div>
                    
                </div>
            </div>
        </div>
    )
};

export default TempHome;
